import React from "react";
import logo1 from "../../assets/logo1.png";

const Footer = () => {
	return (
		<>
			<div className="container grid1">
				<div className="box">
					<img src={logo1} alt="logotipo"/>
				</div>
			</div>
		</>
	);
};

export default Footer;
